import React, { useEffect } from "react";
import { Container, Row, Col, Navbar, Table } from "react-bootstrap";
import axios from "axios";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  useEffect(() => {
    axios
      .get("http://localhost:8010/proxy", {
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
        },
      })
      .then((res) => {
        const data = res.data;
        console.log(data);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  return (
    <Container fluid className="container">
      <Navbar bg="light">
        <Navbar.Brand>Eureka dashboard</Navbar.Brand>
      </Navbar>
      <Table>
        <thead>
          <tr>
            <th>Application Name</th>
            <th>Host</th>
            <th>Instance</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>STUDENTSERVICE</td>
            <td>192.168.10.253</td>
            <td>studentservice:8081</td>
            <td>UP</td>
          </tr>
        </tbody>
      </Table>
    </Container>
  );
}

export default App;
